//Dependencias
import React, { Component } from 'react';

//Componentes
import './styles.css';

class Navigation extends Component{

    render() {
        return(
        <nav className='navbar'>
            <a href="#">
                NotThatEasyTaxy             
            </a>            
        </nav>
        );
    }
}

export default Navigation;
